('0a5eb034-a5dc-6bcf-cc9b-7b1f5b65854d', 32418, 20135, 20099, 20103, NULL, 20103, NULL, '2019-04-01 07:32:51.220000', '2019-04-01 07:32:51.220000', 32417, 0, 32407, 'RSS-NAVIGATION-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-navigation</Name><Name language-id=\"zh_CN\">portlet-display-template-name-navigation</Name><Name language-id=\"nl_NL\">portlet-display-template-name-navigation</Name><Name language-id=\"en_US\">portlet-display-template-name-navigation</Name><Name language-id=\"fi_FI\">portlet-display-template-name-navigation</Name><Name language-id=\"fr_FR\">portlet-display-template-name-navigation</Name><Name language-id=\"de_DE\">portlet-display-template-name-navigation</Name><Name language-id=\"iw_IL\">portlet-display-template-name-navigation</Name><Name language-id=\"hu_HU\">portlet-display-template-name-navigation</Name><Name language-id=\"ja_JP\">portlet-display-template-name-navigation</Name><Name language-id=\"pt_BR\">portlet-display-template-name-navigation</Name><Name language-id=\"es_ES\">portlet-display-template-name-navigation</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-navigation</Description><Description language-id=\"zh_CN\">portlet-display-template-description-navigation</Description><Description language-id=\"nl_NL\">portlet-display-template-description-navigation</Description><Description language-id=\"en_US\">portlet-display-template-description-navigation</Description><Description language-id=\"fi_FI\">portlet-display-template-description-navigation</Description><Description language-id=\"fr_FR\">portlet-display-template-description-navigation</Description><Description language-id=\"de_DE\">portlet-display-template-description-navigation</Description><Description language-id=\"iw_IL\">portlet-display-template-description-navigation</Description><Description language-id=\"hu_HU\">portlet-display-template-description-navigation</Description><Description language-id=\"ja_JP\">portlet-display-template-description-navigation</Description><Description language-id=\"pt_BR\">portlet-display-template-description-navigation</Description><Description language-id=\"es_ES\">portlet-display-template-description-navigation</Description></root>', 'display', NULL, 'ftl', '<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-xs-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-xs-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index > entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												iconCssClass=\"icon-calendar\"\n												label=true\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>', 0, 0, 32419, NULL, NULL),
('cc1de520-99e4-771a-1fa1-8dd733a1d32d', 32421, 20135, 20099, 20103, NULL, 20103, NULL, '2019-04-01 07:32:51.234000', '2019-04-01 07:32:51.234000', 20004, 0, 32407, 'ASSET-CATEGORIES-NAVIGATION-MULTI-COLUMN-LAYOUT-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">תצורה מרובת עמודות</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"zh_CN\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"nl_NL\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"en_US\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"fi_FI\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"fr_FR\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"de_DE\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"iw_IL\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"hu_HU\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"ja_JP\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"pt_BR\">portlet-display-template-description-multi-column-layout</Description><Description language-id=\"es_ES\">portlet-display-template-description-multi-column-layout</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n					</h3>\n				</div>\n\n				<#assign categories = entry.getCategories() />\n\n				<@displayCategories categories=categories />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 0, 32422, NULL, NULL),
('89ef8b5e-fa12-5006-be43-a2d6e48f1f75', 32425, 20135, 20099, 20103, NULL, 20103, NULL, '2019-04-01 07:32:51.259000', '2019-04-01 07:32:51.259000', 32424, 0, 32407, 'DOCUMENTLIBRARY-CAROUSEL-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"zh_CN\">Carousel</Name><Name language-id=\"nl_NL\">Carrousel</Name><Name language-id=\"en_US\">Carousel</Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"iw_IL\">קרוסלה</Name><Name language-id=\"hu_HU\">Körhinta</Name><Name language-id=\"ja_JP\">カルーセル</Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"es_ES\">Carrusel</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"zh_CN\">把图片显示在转盘中。</Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description><Description language-id=\"en_US\">Displays images in a carousel.</Description><Description language-id=\"fi_FI\">Näyttää kuvat karusellissa.</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"iw_IL\">מציג את התמונות בקרוסלה.</Description><Description language-id=\"hu_HU\">Megjeleníti a képeket körhintaszerűen.</Description><Description language-id=\"ja_JP\">カルーセル内に画像を表示</Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"es_ES\">Muestra imágenes en un carrusel.</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>', 0, 0, 32426, NULL, NULL),
('414d03af-c35b-9593-ae7b-79ec6811ac62', 32428, 20135, 20099, 20103, NULL, 20103, NULL, '2019-04-01 07:32:51.277000', '2019-04-01 07:32:51.277000', 20039, 0, 32407, 'SITE-MAP-MULTI-COLUMN-LAYOUT-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">תצורה מרובת עמודות</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"zh_CN\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"nl_NL\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"en_US\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"fi_FI\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"fr_FR\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"de_DE\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"iw_IL\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"hu_HU\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"ja_JP\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"pt_BR\">portlet-display-template-description-multi-column-layout-sitemap</Description><Description language-id=\"es_ES\">portlet-display-template-description-multi-column-layout-sitemap</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						<a\n\n						<#assign layoutType = entry.getLayoutType() />\n\n						<#if layoutType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n						</#if>\n\n						>${entry.getName(locale)}</a>\n					</h3>\n				</div>\n\n				<@displayPages\n					depth=1\n					pages=entry.getChildren()\n				/>\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages\n						depth=depth + 1\n						pages=page.getChildren()\n					/>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 0, 32429, NULL, NULL),
('403f73d0-49b7-66a2-cf7c-81e6c6cf5986', 32431, 20135, 20099, 20103, NULL, 20103, NULL, '2019-04-01 07:32:51.321000', '2019-04-01 07:32:51.321000', 20008, 0, 32407, 'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"zh_CN\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"nl_NL\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"en_US\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"fi_FI\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"fr_FR\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"de_DE\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"iw_IL\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"hu_HU\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"ja_JP\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"pt_BR\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"es_ES\">portlet-display-template-name-color-by-popularity</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"zh_CN\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"nl_NL\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"en_US\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"fi_FI\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"fr_FR\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"de_DE\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"iw_IL\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"hu_HU\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"ja_JP\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"pt_BR\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"es_ES\">portlet-display-template-description-color-by-popularity</Description></root>', 'display', NULL, 'ftl', '<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class=\"tag\" href=\"${tagURL}\" style=\"color: ${color};\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>', 0, 0, 32432, NULL, NULL),
('a6a3cb91-9df9-79fa-210a-dd93d2b03e08', 32435, 20135, 20099, 20103, NULL, 20103, NULL, '2019-04-01 07:32:51.353000', '2019-04-01 07:32:51.353000', 32434, 0, 32407, 'LANGUAGE-ICON-FTL', '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-icon</Name><Name language-id=\"zh_CN\">portlet-display-template-name-icon</Name><Name language-id=\"nl_NL\">portlet-display-template-name-icon</Name><Name language-id=\"en_US\">portlet-display-template-name-icon</Name><Name language-id=\"fi_FI\">portlet-display-template-name-icon</Name><Name language-id=\"fr_FR\">portlet-display-template-name-icon</Name><Name language-id=\"de_DE\">portlet-display-template-name-icon</Name><Name language-id=\"iw_IL\">portlet-display-template-name-icon</Name><Name language-id=\"hu_HU\">portlet-display-template-name-icon</Name><Name language-id=\"ja_JP\">portlet-display-template-name-icon</Name><Name language-id=\"pt_BR\">portlet-display-template-name-icon</Name><Name language-id=\"es_ES\">portlet-display-template-name-icon</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-icon</Description><Description language-id=\"zh_CN\">portlet-display-template-description-icon</Description><Description language-id=\"nl_NL\">portlet-display-template-description-icon</Description><Description language-id=\"en_US\">portlet-display-template-description-icon</Description><Description language-id=\"fi_FI\">portlet-display-template-description-icon</Description><Description language-id=\"fr_FR\">portlet-display-template-description-icon</Description><Description language-id=\"de_DE\">portlet-display-template-description-icon</Description><