ion><Description language-id=\"fi_FI\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"fr_FR\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"de_DE\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"iw_IL\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"hu_HU\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"ja_JP\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"pt_BR\">portlet-display-template-description-navigation-menu-macro</Description><Description language-id=\"es_ES\">portlet-display-template-description-navigation-menu-macro</Description></root>', 'macro', NULL, 'ftl', '<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_attr_selected = \"\"\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_attr_selected = \"aria-selected=\'true\'\"\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\" ${nav_item_attr_selected}>\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>', 0, 0, 33778, NULL, NULL),
