(32443, 20135, 20099, 20103, NULL, '2019-04-01 07:32:51.393000', 32434, 0, 32441, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-long-text</Name><Name language-id=\"zh_CN\">portlet-display-template-name-long-text</Name><Name language-id=\"nl_NL\">portlet-display-template-name-long-text</Name><Name language-id=\"en_US\">portlet-display-template-name-long-text</Name><Name language-id=\"fi_FI\">portlet-display-template-name-long-text</Name><Name language-id=\"fr_FR\">portlet-display-template-name-long-text</Name><Name language-id=\"de_DE\">portlet-display-template-name-long-text</Name><Name language-id=\"iw_IL\">portlet-display-template-name-long-text</Name><Name language-id=\"hu_HU\">portlet-display-template-name-long-text</Name><Name language-id=\"ja_JP\">portlet-display-template-name-long-text</Name><Name language-id=\"pt_BR\">portlet-display-template-name-long-text</Name><Name language-id=\"es_ES\">portlet-display-template-name-long-text</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-long-text</Description><Description language-id=\"zh_CN\">portlet-display-template-description-long-text</Description><Description language-id=\"nl_NL\">portlet-display-template-description-long-text</Description><Description language-id=\"en_US\">portlet-display-template-description-long-text</Description><Description language-id=\"fi_FI\">portlet-display-template-description-long-text</Description><Description language-id=\"fr_FR\">portlet-display-template-description-long-text</Description><Description language-id=\"de_DE\">portlet-display-template-description-long-text</Description><Descripti