cription><Description language-id=\"iw_IL\">portlet-display-template-description-select-box</Description><Description language-id=\"hu_HU\">portlet-display-template-description-select-box</Description><Description language-id=\"ja_JP\">portlet-display-template-description-select-box</Description><Description language-id=\"pt_BR\">portlet-display-template-description-select-box</Description><Description language-id=\"es_ES\">portlet-display-template-description-select-box</Description></root>', 'ftl', '<#if entries?has_content>\n	<#assign languageId = localeUtil.toLanguageId(locale) />\n\n	<style>\n		.taglib-language-option {\n			background: none no-repeat 5px center;\n			padding-left: 25px;\n		}\n\n		<#list entries as entry>\n			.taglib-language-option-${entry.getW3cLanguageId()} {\n				background-image: url(${themeDisplay.getPathThemeImages()}/language/${entry.getLanguageId()}.png);\n			}\n		</#list>\n	</style>\n\n	<@liferay_aui[\"form\"]\n		action=formAction\n		method=\"post\"\n		name=\'${namespace + formName}\'\n		useNamespace=false\n	>\n		<@liferay_aui[\"select\"]\n			changesContext=true\n			id=\'${namespace + formName}\'\n			label=\"\"\n			name=\'${name}\'\n			onChange=\'${namespace + \"changeLanguage();\"}\'\n			title=\"language\"\n		>\n			<#list entries as entry>\n				<@liferay_aui[\"option\"]\n					cssClass=\"taglib-language-option taglib-language-option-${entry.getW3cLanguageId()}\"\n					disabled=entry.isDisabled()\n					label=entry.getLongDisplayName()\n					lang=entry.getW3cLanguageId()\n					selected=entry.isSelected()\n					value=entry.getLanguageId()\n				/>\n			</#list>\n		</@>\n	</@>\n\n	<@liferay_aui[\"script\"]>\n		function ${namespace}changeLanguage() {\n			var languageId = AUI.$(document.${namespace + formName}.${name}).val();\n\n			submitForm(document.${namespace + formName});\n		}\n	</@>\n</#if>', 0, 20103, NULL, '2019-04-01 07:32:51.404000'),
(32449, 20135, 20099, 20103, NULL, '2019-04-01 07:32:51.415000', 32434, 0, 32447, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-short-text</Name><Name language-id=\"zh_CN\">portlet-display-template-name-short-text</Name><Name language-id=\"nl_NL\">portlet-display-template-name-short-text</Name><Name language-id=\"en_US\">portlet-display-template-name-short-text</Name><Name language-id=\"fi_FI\">portlet-display-template-name-short-text</Name><Name language-id=\"fr_FR\">portlet-display-template-name-short-text</Name><Name language-id=\"de_DE\">portlet-display-template-name-short-text</Name><Name language-id=\"iw_IL\">portlet-display-template-name-short-text</Name><Name language-id=\"hu_HU\">portlet-display-template-name-short-text</Name><Name language-id=\"ja_JP\">portlet-display-template-name-short-text</Name><Name language-id=\"pt_BR\">portlet-display-template-name-short-text</Name><Name language-id=\"es_ES\">portlet-display-template-name-short-text</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-short-text</Description><Description language-id=\"zh_CN\">portlet-display-template-description-short-text</Description><Description language-id=\"nl_NL\">portlet-display-template-description-short-text</Description><Description language-id=\"en_US\">portlet-display-template-description-short-text</Description><Description language-id=\"fi_FI\">portlet-display-template-description-short-text</Description><Description language-id=\"fr_FR\">portlet-display-template-description-short-text</Description><Description language-id=\"de_DE\">portlet-display-template-description-short-text</Des