to_trash\", \"delete\"))}\n											${deleteEntryPortletURL.setParameter(\"redirect\", currentURL)}\n											${deleteEntryPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n\n											<@liferay_ui[\"icon-delete\"]\n												label=true\n												trash=trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())\n												url=deleteEntryPortletURL.toString()\n											/>\n										</#if>\n									</@>\n								</div>\n							</div>\n						</div>\n\n						<div class=\"autofit-row widget-metadata\">\n							<div class=\"autofit-col inline-item-before\">\n								<@liferay_ui[\"user-portrait\"]\n									userId=curBlogEntry.userId\n									userName=curBlogEntry.userName\n								/>\n							</div>\n\n							<div class=\"autofit-col autofit-col-expand\">\n								<div class=\"autofit-row\">\n									<div class=\"autofit-col autofit-col-expand\">\n										<#if serviceLocator??>\n											<#assign\n												userLocalService = serviceLocator.findService(\"com.liferay.portal.kernel.service.UserLocalService\")\n\n												entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())\n											/>\n\n											<#if entryUser?? && !entryUser.isDefaultUser()>\n												<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />\n											</#if>\n										</#if>\n\n										<div class=\"text-truncate-inline\">\n											<a href=\"${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, \"\")}\" class=\"text-truncate username\">${curBlogEntry.getUserName()}</a>\n										</div>\n\n										<div>\n											${dateUtil.getDate(curBlogEntry.getStatusDate(), \"dd MMM\", locale)}\n\n											<#if blogsPortletInstanceConfiguration.enableReadingTime()>\n												- <@liferay_reading_time[\"reading-time\"] displayStyle=\"simple\" model=curBlogEntry />\n											</#if>\n\n											<#if serviceLocator??>\n												<#assign\n													assetEntryLocalService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetEntryLocalService\")\n\n													assetEntry = assetEntryLocalService.getEntry(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())\n												/>\n\n												<#if blogsPortletInstanceConfiguration.enableViewCount()>\n													- <@liferay_ui[\"message\"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then(\"x-view\", \"x-views\") />\n												</#if>\n											</#if>\n										</div>\n									</div>\n								</div>\n							</div>\n						</div>\n\n						<#if cardImage>\n							<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(curBlogEntry.getContent()), 150)}</p>\n						<#else>\n							<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(curBlogEntry.getContent()), 400)}</p>\n						</#if>\n					</div>\n\n					<div class=\"card-footer\">\n						<div class=\"card-row\">\n							<div class=\"autofit-float autofit-row autofit-row-center widget-toolbar\">\n								<#if blogsPortletInstanceConfiguration.enableComments()>\n									<div class=\"autofit-col\">\n										<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />\n\n										${viewCommentsPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n										${viewCommentsPortletURL.setParameter(\"scroll\", renderResponse.getNamespace() + \"discussionContainer\")}\n\n										<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n											${viewCommentsPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n										<#else>\n											${viewCommentsPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n										</#if>\n\n										<a class=\"btn btn-outline-borderless btn-outline-secondary btn-sm\" href=\"${viewCommentsPortletURL.toString()}\">\n											<span class=\"inline-item inline-item-before\">\n												<@clay[\"icon\"] symbol=\"comments\" />\n											</span> ${commentManager.getCommentsCount(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())}\n										</a>\n									</div>\n								</#if>\n\n								<#if blogsPortletInstanceConfiguration.enableRatings()>\n									<div class=\"autofit-col\">\n										<@liferay_ui[\"ratings\"]\n											className=\"com.liferay.blogs.model.BlogsEntry\"\n											classPK=curBlogEntry.getEntryId()\n										/>\n									</div>\n								</#if>\n\n								<div class=\"autofit-col autofit-col-end\">\n									<#assign bookmarkURL = renderResponse.createRenderURL() />\n\n									${bookmarkURL.setWindowState(windowStateFactory.getWindowState(\"NORMAL\"))}\n									${bookmarkURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n									<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n										${bookmarkURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n									<#else>\n										${bookmarkURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n									</#if>\n\n									<@liferay_social_bookmarks[\"bookmarks\"]\n										className=\"com.liferay.blogs.model.BlogsEntry\"\n										classPK=curBlogEntry.getEntryId()\n										displayStyle=\"menu\"\n										target=\"_blank\"\n										title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)\n										types=blogsPortletInstanceConfiguration.socialBookmarksTypes()\n										url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())\n									/>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n		</#list>\n	</#if>\n</div>', 0, 20103, NULL, '2019-04-01 07:32:59.340000');
INSERT INTO `DDMTemplateVersion` (`templateVersionId`, `groupId`, `companyId`, `userId`, `userName`, `createDate`, `classNameId`, `classPK`, `templateId`, `version`, `name`, `description`, `language`, `script`, `status`, `statusByUserId`, `statusByUserName`, `statusDate`) VALUES
(33707, 20135, 20099, 20103, NULL, '2019-04-01 07:33:04.008000', 33702, 0, 33705, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">Social</Name><Name language-id=\"zh_CN\">社交</Name><Name language-id=\"nl_NL\">Sociaal</Name><Name language-id=\"en_US\">Social</Name><Name language-id=\"fi_FI\">Sosiaalinen</Name><Name language-id=\"fr_FR\">Social</Name><Name language-id=\"de_DE\">Social</Name><Name language-id=\"iw_IL\">חברתי</Name><Name language-id=\"hu_HU\">Közösségi</Name><Name language-id=\"ja_JP\">ソーシャル</Name><Name language-id=\"pt_BR\">Social</Name><Name language-id=\"es_ES\">Social</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">Mostra adreces d\'interès socials i classificacions per a planes del wiki.</Description><Description language-id=\"zh_CN\">显示社交书签和维基页的评分和它们的子页。</Description><Description language-id=\"nl_NL\">Geeft sociale favorieten en waarderingen van wikipagina\'s en onderliggende wikipagina\'s weer.</Description><Description language-id=\"en_US\">Displays social bookmarks and ratings for wiki pages and their child pages.</Description><Description language-id=\"fi_FI\">Näyttää sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id=\"fr_FR\">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id=\"de_DE\">Darstellung für Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description><Description language-id=\"iw_IL\">מציג סימניות חברתיות ודירוגים עבור דפי וויקי והדפים הבנים שלהם.</Description><Description language-id=\"hu_HU\">Megjeleníti a közösségi könyvjelzőket és értékeléseket a wiki oldalak és gyermek oldalaik részére.</Description><Description language-id=\"ja_JP\">Wikiページとそのサブページ用のソーシャルブックマークと評価を表示する</Description><Description language-id=\"pt_BR\">Exibe marcadores sociais e avaliações para páginas da wiki e suas páginas filhas.</Description><Description language-id=\"es_ES\">Muestra los marcadores sociales y las clasificaciones para páginas wiki y sus páginas secundarias.</Description></root>', 'ftl', '<#assign\n	wikiPageClassName = \"com.liferay.wiki.model.WikiPage\"\n\n	assetRenderer = assetEntry.getAssetRenderer()\n/>\n\n<div class=\"taglib-header\">\n	<h1 class=\"header-title\">${entry.getTitle()}</h1>\n</div>\n\n<div style=\"float: right;\">\n	<@getEditIcon />\n\n	<@getPageDetailsIcon />\n\n	<@getPrintIcon />\n</div>\n\n<div class=\"wiki-body\">\n	<div class=\"wiki-info\">\n		<span class=\"stats\">${assetEntry.getViewCount()} <@liferay.language key=\"views\" /></span> |\n\n		<span class=\"date\"><@liferay.language key=\"last-modified\" /> ${dateUtil.getDate(entry.getModifiedDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}</span>\n\n		<span class=\"author\"><@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>\n	</div>\n\n	<div class=\"wiki-content\">\n		<@liferay_social_bookmarks[\"bookmarks\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			displayStyle=\"normal\"\n			target=\"_blank\"\n			title=entry.getTitle()\n			url=viewURL\n		/>\n\n		${formattedContent}\n	</div>\n\n	<div class=\"page-actions\">\n		<div class=\"article-actions\">\n			<@getAddChildPageIcon />\n\n			<@getAttatchmentsIcon />\n		</div>\n	</div>\n\n	 <br />\n\n	<@getRatings\n		cssClass=\"page-ratings\"\n		entry=entry\n	/>\n\n	<@getRelatedAssets />\n</div>\n\n<div class=\"page-categorization\">\n	<div class=\"page-categories\">\n		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />\n\n		${viewCategorizedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_categorized_pages\")}\n		${viewCategorizedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-categories-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewCategorizedPagesURL\n		/>\n	</div>\n\n	<div class=\"page-tags\">\n		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />\n\n		${viewTaggedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_tagged_pages\")}\n		${viewTaggedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-tags-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewTaggedPagesURL\n		/>\n	</div>\n</div>\n\n<#assign childPages = entry.getChildPages() />\n\n<#if (childPages?has_content)>\n	<div class=\"child-pages\">\n		<h2><@liferay.language key=\"children-pages\" /></h2>\n\n		<table class=\"taglib-search-iterator\">\n			<tr class=\"portlet-section-header results-header\">\n				<th>\n					<@liferay.language key=\"page\" />\n				</th>\n				<th>\n					<@liferay.language key=\"last-modified\" />\n				</th>\n				<th>\n					<@liferay.language key=\"ratings\" />\n				</th>\n			</tr>\n\n			<#list childPages as childPage>\n				<tr class=\"results-row\">\n					<#assign viewPageURL = renderResponse.createRenderURL() />\n\n					${viewPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view\")}\n\n					<#assign childNode = childPage.getNode() />\n\n					${viewPageURL.setParameter(\"nodeName\", childNode.getName())}\n					${viewPageURL.setParameter(\"title\", childPage.getTitle())}\n\n					<td>\n						<a href=\"${viewPageURL}\">${childPage.getTitle()}</a>\n					</td>\n					<td>\n						<a href=\"${viewPageURL}\">${dateUtil.getDate(childPage.getModifiedDate(),\"dd MMM yyyy - HH:mm:ss\", locale)} <@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>\n					</td>\n					<td>\n						<@getRatings\n							cssClass=\"child-ratings\"\n							entry=childPage\n						/>\n					</td>\n				</tr>\n			</#list>\n		</table>\n	</div>\n</#if>\n\n<@getDiscussion />\n\n<#macro getAddChildPageIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign addPageURL = renderResponse.createRenderURL() />\n\n		${addPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${addPageURL.setParameter(\"redirect\", currentURL)}\n		${addPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${addPageURL.setParameter(\"title\", \"\")}\n		${addPageURL.setParameter(\"editTitle\", \"1\")}\n		${addPageURL.setParameter(\"parentTitle\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-plus\"\n			label=true\n			message=\"add-child-page\"\n			url=addPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getAttatchmentsIcon>\n	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />\n\n	${viewPageAttachmentsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_attachments\") }\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-paperclip\"\n		label=true\n		message=\'${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, \"attachments\")}\'\n		url=viewPageAttachmentsURL?string\n	/>\n</#macro>\n\n<#macro getDiscussion>\n	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>\n		<br />\n\n		<#assign discussionURL = renderResponse.createActionURL() />\n\n		${discussionURL.setParameter(\"javax.portlet.action\", \"/wiki/\" + assetRenderer.getDiscussionPath())}\n\n		<@liferay_comment[\"discussion\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			formAction=discussionURL?string\n			formName=\"fm2\"\n			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()\n			redirect=currentURL\n			subject=assetRenderer.getTitle(locale)\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPageURL = renderResponse.createRenderURL() />\n\n		${editPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${editPageURL.setParameter(\"redirect\", currentURL)}\n		${editPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${editPageURL.setParameter(\"title\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-edit\"\n			message=entry.getTitle()\n			url=editPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getPageDetailsIcon>\n	<#assign viewPageDetailsURL = renderResponse.createRenderURL() />\n\n	${viewPageDetailsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_details\")}\n	${viewPageDetailsURL.setParameter(\"redirect\", currentURL)}\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-file-alt\"\n		message=\"details\"\n		url=viewPageDetailsURL?string\n	/>\n</#macro>\n\n<#macro getPrintIcon>\n	<#assign printURL = renderResponse.createRenderURL() />\n\n	${printURL.setParameter(\"viewMode\", \"print\")}\n	${printURL.setWindowState(\"pop_up\")}\n\n	<#assign\n		title = languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", htmlUtil.escape(assetRenderer.getTitle(locale))], false)\n		taglibPrintURL = \"javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + title + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n	/>\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-print\"\n		message=\"print\"\n		url=taglibPrintURL\n	/>\n</#macro>\n\n<#macro getRatings\n	cssClass\n	entry\n>\n	<#if wikiPortletInstanceConfiguration.enablePageRatings()>\n		<div class=\"${cssClass}\">\n			<@liferay_ui[\"ratings\"]\n				className=wikiPageClassName\n				classPK=entry.getResourcePrimKey()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>\n		<@liferay_ui[\"asset-links\"] assetEntryId=assetEntry.getEntryId() />\n	</#if>\n</#macro>', 0, 20103, NULL, '2019-04-01 07:33:04.008000'),
(33713, 20135, 20099, 20103, NULL, '2019-04-01 07:33:04.056000', 32341, 33708, 33711, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">Contigut web bàsic</Name><Name language-id=\"zh_CN\">基本 Web 内容</Name><Name language-id=\"nl_NL\">Basiswebcontent</Name><Name language-id=\"en_US\">Basic Web Content</Name><Name language-id=\"fi_FI\">Tavallinen web-sisältö</Name><Name language-id=\"fr_FR\">Contenu web de base</Name><Name language-id=\"de_DE\">Einfacher Webcontent</Name><Name language-id=\"iw_IL\">תוכן אינטרנטי בסיסי</Name><Name language-id=\"hu_HU\">Alapvető webtartalom</Name><Name language-id=\"ja_JP\">基本Webコンテンツ</Name><Name language-id=\"pt_BR\">Conteúdo Web básico</Name><Name language-id=\"es_ES\">Contenido web básico</Name></root>', '', 'ftl', '${content.getData()}', 0, 20103, NULL, '2019-04-01 07:33:04.056000'),
(33752, 20135, 20099, 20103, NULL, '2019-04-01 07:33:04.966000', 27439, 0, 33750, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-list-menu</Name><Name language-id=\"zh_CN\">portlet-display-template-name-list-menu</Name><Name language-id=\"nl_NL\">portlet-display-template-name-list-menu</Name><Name language-id=\"en_US\">portlet-display-template-name-list-menu</Name><Name language-id=\"fi_FI\">portlet-display-template-name-list-menu</Name><Name language-id=\"fr_FR\">portlet-display-template-name-list-menu</Name><Name language-id=\"de_DE\">portlet-display-template-name-list-menu</Name><Name language-id=\"iw_IL\">portlet-display-template-name-list-menu</Name><Name language-id=\"hu_HU\">portlet-display-template-name-list-menu</Name><Name language-id=\"ja_JP\">portlet-display-template-name-list-menu</Name><Name language-id=\"pt_BR\">portlet-display-template-name-list-menu</Name><Name language-id=\"es_ES\">portlet-display-template-name-list-menu</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-list-menu</Description><Description language-id=\"zh_CN\">portlet-display-template-description-list-menu</Description><Description language-id=\"nl_NL\">portlet-display-template-description-list-menu</Description><Description language-id=\"en_US\">portlet-display-template-description-list-menu</Description><Description language-id=\"fi_FI\">portlet-display-template-description-list-menu</Description><Description language-id=\"fr_FR\">portlet-display-template-description-list-menu</Description><Description language-id=\"de_DE\">portlet-display-template-description-list-menu</Description><Description language-id=\"iw_IL\">portlet-display-template-description-list-menu</Description><Description language-id=\"hu_HU\">portlet-display-template-description-list-menu</Description><Description language-id=\"ja_JP\">portlet-display-template-description-list-menu</Description><Description language-id=\"pt_BR\">portlet-display-template-description-list-menu</Description><Description language-id=\"es_ES\">portlet-display-template-description-list-menu</Description></root>', 'ftl', '<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign includeAllChildNavItems = false />\n\n	<#if stringUtil.equals(includedLayouts, \"all\")>\n		<#assign includeAllChildNavItems = true />\n	</#if>\n\n	<div aria-label=\"<@liferay.language key=\"site-pages\" />\" class=\"list-menu\">\n		<@buildNavigation\n			branchNavItems=branchNavItems\n			cssClass=\"layouts\"\n			displayDepth=displayDepth\n			includeAllChildNavItems=includeAllChildNavItems\n			navItemLevel=1\n			navItems=entries\n		/>\n	</div>\n</#if>', 0, 20103, NULL, '2019-04-01 07:33:04.966000'),
(33755, 20135, 20099, 20103, NULL, '2019-04-01 07:33:04.980000', 27439, 0, 33753, '1.0', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-nav-pills</Name><Name language-id=\"zh_CN\">portlet-display-template-name-nav-pills</Name><Name language-id=\"nl_NL\">portlet-display-template-name-nav-pills</Name><Name language-id=\"en_US\">portlet-display-template-name-nav-pills</Name><Name language-id=\"fi_FI\">portlet-display-template-name-nav-pills</Name><Name language-id=\"fr_FR\">portlet-display-template-name-nav-pills</Name><Name language-id=\"de_DE\">portlet-display-template-name-nav-pills</Name><Name language-id=\"iw_IL\">portlet-display-template-name-nav-pills</Name><Name language-id=\"hu_HU\">portlet-display-template-name-nav-pills</Name><Name language-id=\"ja_JP\">portlet-display-template-name-nav-pills</Name><Name language-id=\"pt_BR\">portlet-display-template-name-nav-pills</Name><Name language-id=\"es_ES\">portlet-display-template-name-nav-pills</Name></root>', '<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-nav-pills</Description><Description language-id=\"zh_CN\">portlet-display-template-description-nav-pills</Description><Description language-id=\"nl_NL\">portlet-display-template-description-nav-pills</Description><Description language-id=\"en_US\">portlet-display-template-description-nav-pills</Description><Description language-id=\"fi_FI\">portlet-display-template-description-nav-pills</Description><Description language-id=\"fr_FR\">portlet-display-template-description-nav-pills</Description><Description language-id=\"de_DE\">portlet-display-template-description-nav-pills</Description><Description language-id=\"iw_IL\">portlet-display-template-description-nav-pills</Description><Description language-id=\"hu_HU\">portlet-display-template-description-nav-pills</Description><Description language-id=\"ja_JP\">portlet-display-template-description-nav-pills</Description><Description language-id=\"pt_BR\">portlet-display-template-description-nav-pills</Description><Description language-id=\"es_ES\">portlet-display-template-description-nav-pills</Description></root>', 'ftl', '<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul aria-label=<@liferay.language key=\"site-pages\" />\" class=\"nav nav-pills navbar-site\" role=\"menubar\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildren = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildren>\n					<#assign\n						nav_item_attr_has_popup = \"\"\n						nav_item_attr_selected = \"\"\n						nav_item_caret = \"\"\n						nav_item_css_class = \"lfr-nav-item nav-item\"\n						nav_item_href_link = \"\"\n						nav_item_link_css_class = \"nav-link text-truncate\"\n					/>\n\n					<#if showChildren>\n						<#assign nav_item_attr_has_popup = \"aria-haspopup=\'true\'\" />\n						<#assign nav_item_caret = \'<span class=\"lfr-nav-child-toggle\"><i class=\"icon-caret-down\"></i></span>\' />\n						<#assign\n							nav_item_css_class = \"${nav_item_css_class} dropdown\"\n							nav_item_link_css_class = \"${nav_item_link_css_class} dropdown-toggle\"\n						/>\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\'\" />\n					</#if>\n\n					<#if navItem.isSelected()>\n						<#assign\n							nav_item_attr_selected = \"aria-selected=\'true\'\"\n							nav_item_css_class = \"${nav_item_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${navItem.getLayoutId()}\" ${nav_item_attr_selected} role=\"presentation\">\n						<a aria-labelledby=\"layout_${navItem.getLayoutId()}\" ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildren>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<#list navItem.getBrowsableChildren() as childNavigationItem>\n									<#assign\n										nav_child_attr_selected = \"\"\n										nav_child_css_class = \"\"\n									/>\n\n									<#if childNavigationItem.isSelected()>\n										<#assign\n											nav_child_attr_selected = \"aria-selected=\'true\'\"\n											nav_child_css_class = \"active selected\"\n										/>\n									</#if>\n\n									<li class=\"${nav_child_css_class}\" id=\"layout_${childNavigationItem.getLayoutId()}\" ${nav_child_attr_selected} role=\"presentation\">\n										<a aria-labelledby=\"layout_${childNavigationItem.getLayoutId()}\" class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n									</li>\n								</#list>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>', 0, 20103, NULL, '201