('5dc51414-a1d5-c45c-a28b-37bf81e51eee', 29522, 20099, 0, NULL, '2019-04-01 07:32:37.578000', '2019-04-01 07:32:37.578000', 106186206, 'Liferay CE Dynamic Data Mapping', 'Liferay CE', 'Productivity', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106186210', '1.0.0', 1),
('89581a75-0b08-9f4d-2578-f33f647e16f9', 29560, 20099, 0, NULL, '2019-04-01 07:32:37.407000', '2019-04-01 07:32:37.407000', 109803166, 'Liferay CE External Reference', 'Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay CE bundle.', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/109803171', '1.0.0', 1),
('96107c23-2e5d-bbcb-7fc2-5d3ce5e1ba49', 29563, 20099, 0, NULL, '2019-04-01 07:32:37.695000', '2019-04-01 07:32:37.695000', 106185628, 'Liferay CE Mentions', 'Liferay CE', 'Communication', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106185632', '1.0.0', 1),
('8869014c-dca3-dc2b-9332-74699ac7d9e2', 29567, 20099, 0, NULL, '2019-04-01 07:32:39.382000', '2019-04-01 07:32:39.382000', 106189680, 'Liferay CE Frontend Editor', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106189684', '1.0.0', 1),
('f9f4c3d1-ac9d-3f74-da32-c31e2660c9a1', 29575, 20099, 0, NULL, '2019-04-01 07:32:38.119000', '2019-04-01 07:32:38.119000', 103226467, 'Liferay CE Adaptive Media', 'The Adaptive Media app tailors media in your portal to the device consuming it. Since users often consume media on multiple devices that have different screen sizes and capabilities, you should make sure that your portal presents that media in a manner suitable for each device. For example, portal administrators can configure the Adaptive Media app to send high-res images to high-res devices, low-res images to low-res devices, and so on. This ensures that your users have the best possible experience when consuming media from your portal, regardless of the device they use.Note that at this time, the Adaptive Media app only works with images in Documents and Media, Blogs, and Web Content.Once installed, the Adaptive Media app appears in the Control Panel, under the Configuration menu.Please see the documentation for special installation instructions on Liferay Portal 7.0 CE GA5.', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110380277', '2.0.0', 0),
