('21156ac7-a3c3-4961-2a6c-26295eddbb00', 29630, 20099, 0, NULL, '2019-04-01 07:32:39.673000', '2019-04-01 07:32:39.673000', 25019275, 'Liferay Marketplace', 'Liferay Marketplace is an integral part of the Liferay platform experience for all users. Enterprise subscribers also have exclusive access to Liferay Subscription Apps through the Liferay Marketplace. Log in with your Liferay account to browse hundreds of apps to help you build your business or technical solution.', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110879471', '9', 1),
('8eddbee4-31e8-be15-c0bb-3fe9dec446cf', 29635, 20099, 0, NULL, '2019-04-01 07:32:35.859000', '2019-04-01 07:32:35.859000', 106191431, 'Liferay CE WebSocket', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106191435', '1.0.0', 1),
('0ce6e416-0fb3-b018-1160-fe16da91e804', 29637, 20099, 0, NULL, '2019-04-01 07:32:38.226000', '2019-04-01 07:32:38.226000', 31070085, 'Liferay CE Calendar', 'Liferay\'s Calendar app allows users and organizations to create, track, share, and manage events. In addition, the Calendar app supports notifications, integration with Social Office, and staging. As a user, you can create as many calendars as you need. As an administrator, you are able to manage the scheduling of Calendar Resources such as rooms and projectors. All content from the old Calendar portlet is automatically imported into this new application.', 'Communication', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110377671', '3.0.0', 0),
