('9aea54a7-7e56-522a-8b48-7a0a461aee0e', 30080, 20099, 0, NULL, '2019-04-01 07:32:36.984000', '2019-04-01 07:32:36.984000', 106190284, 'Liferay CE Monitoring', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106190288', '1.0.0', 1),
('9bf53606-c674-c7ed-f53d-b99a26b5ebdf', 30100, 20099, 0, NULL, '2019-04-01 07:32:37.043000', '2019-04-01 07:32:37.043000', 109803263, 'Liferay CE Meris', 'Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay CE bundle.', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/109803268', '1.0.0', 1),
