('2680c773-fafb-0512-2598-7dadb23113e5', 30653, 20099, 0, NULL, '2019-04-01 07:32:38.832000', '2019-04-01 07:32:38.832000', 106177263, 'Liferay CE Document Library', 'Liferay CE', 'Communication', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106177267', '1.0.0', 1),
('1edc9467-4d80-2ef0-1095-809a0decdfb5', 30677, 20099, 0, NULL, '2019-04-01 07:32:39.548000', '2019-04-01 07:32:39.548000', 106189471, 'Liferay CE Configuration Admin', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106189475', '1.0.0', 1),
('c3f52483-3d8d-3bb9-e446-c3db73b23817', 30688, 20099, 0, NULL, '2019-04-01 07:32:38.608000', '2019-04-01 07:32:38.608000', 108268021, 'Liferay CE Portal Validation', 'Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay CE bundle.', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/108268026', '1.0.0', 1),
('37f8c107-a87b-955f-dbe9-6580dbfdca8a', 30789, 20099, 0, NULL, '2019-04-01 07:32:39.271000', '2019-04-01 07:32:39.271000', 106191103, 'Liferay CE Portal Settings', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106191107', '1.0.0', 1),
('fae46a7d-2341-b7ec-3cac-ed67d2061c9f', 30801, 20099, 0, NULL, '2019-04-01 07:32:39.348000', '2019-04-01 07:32:39.348000', 106190479, 'Liferay CE Portal Background Task', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106190483', '1.0.0', 1),
('e23ffdcc-3caf-e412-a10d-71935e67e36c', 30805, 20099, 0, NULL, '2019-04-01 07:32:38.935000', '2019-04-01 07:32:38.935000', 106189810, 'Liferay CE Frontend Theme', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106189814', '1.0.0', 1),
('f19c31eb-f23d-6012-fdf5-09c517d60494', 30866, 20099, 0, NULL, '2019-04-01 07:32:39.235000', '2019-04-01 07:32:39.235000', 15197613, 'Liferay CE Knowledge Base', 'Liferay\'s Knowledge Base app provides a means for creating and organizing articles within a site. The knowledge base is perfect for creating and organizing information more formally than in a wiki. For example, it can be used to organize and display professional product documentation. The knowledge base lets you import article source files written in Markdown, so you can work on them offline before publishing. Its integration with GitHub allows you to give users access to contribute fixes or improvements to articles. It\'s easy to set up the knowledge base with a workflow that requires articles to be approved before they are published. Additionally, it allows administrators to create article templates. Templates can be used to ensure that certain kinds of articles possess a common structure and include certain kinds of information. Knowledge base articles can be categorized to make them easy to find. They can also be organized hierarchically to form complete books or guides. There are multiple portlets included in this app.This app will appear in your Application menu and Site Administration once installed.', 'Productivity', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110878777', '4.0.0', 0),
('a2b1b3fc-170d-6ca5-451f-347dd526072a', 30889, 20099, 0, NULL, '2019-04-01 07:32:39.266000', '2019-04-01 07:32:39.266000', 106178368, 'Liferay CE Image Uploader', 'Liferay CE', 'Communication', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106178372', '1.0.0', 1),
('f16a9119-32d6-60da-bee4-a8a7fa06fadd', 30950, 20099, 0, NULL, '2019-04-01 07:32:39.484000', '2019-04-01 07:32:39.484000', 106190669, 'Liferay CE Portal Language', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106190673', '1.0.0', 1),
('e2228213-180e-d77b-656f-4492cc22d496', 30956, 20099, 0, NULL, '2019-04-01 07:32:39.504000', '2019-04-01 07:32:39.504000', 106191271, 'Liferay CE Text Localizer', 'Liferay CE', 'Utility', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106191275', '1.0.0', 1),
('7e8ac1f8-c940-2deb-a03e-611c0ae0d04a', 30959, 20099, 0, NULL, '2019-04-01 07:32:39.529000', '2019-04-01 07:32:39.529000', 110543843, 'Liferay CE Invite Members', 'The Liferay Collaboration suite provides applications and features that help users share ideas, implement them, and produce terrific results. Its apps such as Message Boards and Blogs help users start discussions, ask questions, share ideas, and connect with other users. Wiki allows users to share in-depth information. And Alerts and Announcements facilitate broadcasting information and notifications.As users collaborate, they\'re sure to produce important files. The suite\'s Documents and Media Library allows users to store files, share them, and publish them. It not only works with Liferay\'s built-in repository but also allows you to integrate with external repositories, such CMIS repositories. Users can add and share all kinds of files, including documents, presentations, images, and videos. And the suite\'s Documents and Media app and Media Gallery help users display files the way they like them.As users engage in site activities, you\'ll want to recognize them and connect them with other users. The suite\'s social networking apps and features enable you to attribute social equity to active users automatically by increasing their rank on the site. You can even highlight user activities to show your site\'s liveliness. The Mentions feature facilitates notifying specific users in the context of site content, discussions, and comments. The social apps also help users share their thoughts on the your sites and other social sites, such as Facebook and Twitter. Combined with the suite\'s collaboration and document management features, the Collaboration suiteâs social features help develop awesome communities, foster high morale, and make work interesting.Apps and Features: Activities, Alerts, Announcements, Blogs, Bookmarks, Comments, Friends/My Sites/Portal/Site Members Directory, Documents and Media, Friend Requests, Image Uploader, Invite Members, Media Gallery, Message Boards, Mentions, Microblogs, Page Flags/Comments/Ratings, Quick Note, Requests, Social Activity, User/Group Statistics, Wiki.This suite may contain modules that depend on Foundation suite modules. This suite is available in the Liferay CE bundle.', 'Communication', 'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110543848', '1.0.0', 1),
